import React from "react"
import "./GuessRow.css"
import Letter from "../Letter/Letter"

export default function GuessRow (params) {
    const {
        id, 
        keywordLetters,
        boardLetters,
        boardEvaluated
    } = params
    return (
        <div 
            className ="row"
            id = {id}
        >
            {[...Array(keywordLetters).keys()].map((arg) => {
                console.log(boardEvaluated[id][arg] === undefined)
                console.log(boardLetters[id][arg] === undefined)
                return(
                    <Letter
                        key = {arg}
                        id = {arg}
                        className={boardEvaluated[id][arg]}
                        value={boardLetters[id][arg]}
                    />
                )
            })}
        </div> 
    )
}
